}

#[test]
fn test_vec_collection_pattern() {
    // Test the flatten().collect() pattern used in the code
    let nested: Vec<Result<Vec<i32>, ()>> = vec![
        Ok(vec![1, 2]),
        Ok(vec![3, 4]),
        Ok(vec![5]),
    ];

    let flattened: Vec<i32> = nested.into_iter()
        .flatten()
        .flatten()
        .collect();

    assert_eq!(flattened, vec![1, 2, 3, 4, 5]);
}

